import logo from './logo.svg';
import './App.css';

import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Home from './pages/Home';
import React from 'react';

class App extends React.Component {

  render(){
    return(
      <Router>
        <Switch>
          <Route path="/">
              <Home />
          </Route>
        </Switch>
      </Router>
    )
  }

}

export default App;
